import React from "react"
import { NavLink } from 'react-router-dom';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHome } from "@fortawesome/free-solid-svg-icons";
import { faSignOutAlt } from "@fortawesome/free-solid-svg-icons";
import { faUsers } from "@fortawesome/free-solid-svg-icons";





const NavBar = () => {
    return (
        <div className="NavBarContainer">
            <NavLink to="/log_in" exact className="NavBarIcon"><FontAwesomeIcon icon={faHome} style={{ color: 'seagreen' }} size="4x" /></NavLink>
            <NavLink to="/log_in" exact className="NavBarIcon"><FontAwesomeIcon icon={faUsers} style={{ color: 'seagreen' }} size="4x" /></NavLink>
            <NavLink to="/log_in" exact className="NavBarIcon"><FontAwesomeIcon icon={faSignOutAlt} style={{ color: 'crimson' }} size="4x" /></NavLink>
        </div>)
}

export default NavBar
